import React from 'react'

import './InputPrompt.scss'

export default class InputPrompt extends React.Component {
    constructor(props) {
        super(props);
        
        this.state = {
            operation: this.props.operation
        }
    }

    render() {
        return (
            <>
                <div className='prompt-container'>

                    <div className='input-container'>
                        <div className='input-message'>Please select element to {  }</div>
                        <input className='input-number' type='number' step='1' />
                        <button className='input-confirm'>{this.state.operation}</button>
                        <button className='input-cancel'>Cancel</button>
                    </div>

                    <div className='prompt-background' />

                </div>
            </>
        );
    }
}
